import React, { useState } from 'react';
import {
  Container,
  TextField,
  Button,
  Typography,
  Paper,
  Box,
  CircularProgress,
  Alert,
  Grid,
  Card,
  CardContent,
  CardHeader,
  Divider,
} from '@mui/material';
import {
  Security,
  Warning,
  CheckCircle,
  Error,
  Speed,
  Link,
} from '@mui/icons-material';
import axios from 'axios';

// Create axios instance with default config
const api = axios.create({
  baseURL: 'http://localhost:5001',
  headers: {
    'Content-Type': 'application/json',
  },
  withCredentials: true,
  timeout: 30000 // Increased timeout to 30 seconds
});

function App() {
  const [url, setUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');

  const analyzeUrl = async () => {
    if (!url) {
      setError('Please enter a URL');
      return;
    }

    setLoading(true);
    setError('');
    setResult(null);

    try {
      console.log('Sending request to analyze URL:', url);
      const response = await api.post('/api/analyze', { url });
      console.log('Received response:', response.data);
      setResult(response.data);
    } catch (err) {
      console.error('Error details:', err);
      if (err.response) {
        // The request was made and the server responded with a status code
        // that falls out of the range of 2xx
        setError(err.response.data.error || 'Server error occurred');
      } else if (err.request) {
        // The request was made but no response was received
        setError('No response from server. Please check if the backend is running.');
      } else {
        // Something happened in setting up the request that triggered an Error
        setError('Error setting up the request');
      }
    } finally {
      setLoading(false);
    }
  };

  const getThreatColor = (level) => {
    switch (level) {
      case 'HIGH':
        return 'error';
      case 'MEDIUM':
        return 'warning';
      case 'LOW':
        return 'success';
      default:
        return 'info';
    }
  };

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h3" component="h1" gutterBottom align="center">
        Cyber Threat Detection System
      </Typography>

      <Paper elevation={3} sx={{ p: 3, mb: 3 }}>
        <Box sx={{ display: 'flex', gap: 2, mb: 2 }}>
          <TextField
            fullWidth
            label="Enter URL to analyze"
            variant="outlined"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="https://example.com"
          />
          <Button
            variant="contained"
            color="primary"
            onClick={analyzeUrl}
            disabled={loading}
            sx={{ minWidth: 120 }}
          >
            {loading ? <CircularProgress size={24} /> : 'Analyze'}
          </Button>
        </Box>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        {result && (
          <Box sx={{ mt: 3 }}>
            <Typography variant="h5" gutterBottom>
              Real-time Analysis Results
            </Typography>

            <Grid container spacing={3}>
              {/* Basic Information */}
              <Grid item xs={12} md={6}>
                <Card>
                  <CardHeader
                    avatar={<Link />}
                    title="Domain Information"
                  />
                  <CardContent>
                    <Typography variant="body1" gutterBottom>
                      Domain: {result.domain}
                    </Typography>
                    <Alert
                      severity={result.ssl_secure ? 'success' : 'error'}
                      sx={{ mt: 1 }}
                    >
                      SSL Security: {result.ssl_secure ? 'Secure' : 'Not Secure'}
                    </Alert>
                  </CardContent>
                </Card>
              </Grid>

              {/* Threat Level */}
              <Grid item xs={12} md={6}>
                <Card>
                  <CardHeader
                    avatar={<Warning />}
                    title="Threat Assessment"
                  />
                  <CardContent>
                    <Alert
                      severity={getThreatColor(result.threat_level)}
                      sx={{ mb: 2 }}
                    >
                      Threat Level: {result.threat_level}
                    </Alert>
                    {result.threat_reasons && result.threat_reasons.length > 0 && (
                      <Box>
                        <Typography variant="subtitle2" gutterBottom>
                          Threat Reasons:
                        </Typography>
                        {result.threat_reasons.map((reason, index) => (
                          <Typography key={index} variant="body2" color="error" gutterBottom>
                            • {reason}
                          </Typography>
                        ))}
                      </Box>
                    )}
                  </CardContent>
                </Card>
              </Grid>

              {/* Domain Age */}
              {result.domain_age_days !== null && (
                <Grid item xs={12} md={6}>
                  <Card>
                    <CardHeader
                      avatar={<Warning />}
                      title="Domain Age"
                    />
                    <CardContent>
                      <Typography variant="body1">
                        {result.domain_age_days} days old
                      </Typography>
                    </CardContent>
                  </Card>
                </Grid>
              )}

              {/* Security Headers */}
              {result.security_headers && (
                <Grid item xs={12} md={6}>
                  <Card>
                    <CardHeader
                      avatar={<Security />}
                      title="Security Headers"
                    />
                    <CardContent>
                      <Grid container spacing={1}>
                        {Object.entries(result.security_headers).map(([header, value]) => (
                          <Grid item xs={12} key={header}>
                            <Typography variant="subtitle2">{header}</Typography>
                            <Alert
                              severity={value === 'Not Set' ? 'warning' : 'success'}
                              sx={{ mt: 0.5 }}
                            >
                              {value}
                            </Alert>
                          </Grid>
                        ))}
                      </Grid>
                    </CardContent>
                  </Card>
                </Grid>
              )}

              {/* Open Ports */}
              {result.open_ports && result.open_ports.length > 0 && (
                <Grid item xs={12} md={6}>
                  <Card>
                    <CardHeader
                      avatar={<Error />}
                      title="Open Ports"
                    />
                    <CardContent>
                      <Alert severity="warning">
                        {result.open_ports.join(', ')}
                      </Alert>
                    </CardContent>
                  </Card>
                </Grid>
              )}

              {/* Suspicious Patterns */}
              {result.suspicious_patterns && result.suspicious_patterns.length > 0 && (
                <Grid item xs={12} md={6}>
                  <Card>
                    <CardHeader
                      avatar={<Error />}
                      title="Suspicious Patterns"
                    />
                    <CardContent>
                      {result.suspicious_patterns.map((pattern, index) => (
                        <Typography key={index} variant="body2" color="error" gutterBottom>
                          • {pattern}
                        </Typography>
                      ))}
                    </CardContent>
                  </Card>
                </Grid>
              )}

              {/* Traffic Analysis */}
              <Grid item xs={12} md={6}>
                <Card>
                  <CardHeader
                    avatar={<Speed />}
                    title="Traffic Analysis"
                  />
                  <CardContent>
                    <Typography variant="body2" component="pre" sx={{ 
                      whiteSpace: 'pre-wrap',
                      wordBreak: 'break-word',
                      backgroundColor: '#f5f5f5',
                      p: 1,
                      borderRadius: 1
                    }}>
                      {result.traffic_analysis.success
                        ? result.traffic_analysis.output
                        : 'Traffic analysis failed'}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>

              {/* Recommendations */}
              <Grid item xs={12}>
                <Card>
                  <CardHeader
                    avatar={<CheckCircle />}
                    title="Recommendations"
                  />
                  <CardContent>
                    <Grid container spacing={1}>
                      {result.recommendations.map((rec, index) => (
                        <Grid item xs={12} sm={6} md={4} key={index}>
                          <Typography variant="body2" sx={{ display: 'flex', alignItems: 'center' }}>
                            <CheckCircle color="success" sx={{ mr: 1, fontSize: 16 }} />
                            {rec}
                          </Typography>
                        </Grid>
                      ))}
                    </Grid>
                  </CardContent>
                </Card>
              </Grid>
            </Grid>
          </Box>
        )}
      </Paper>
    </Container>
  );
}

export default App;
